column8:
持ちやすい弾力のあるグリップで、軽量アルミだから持ち運びラクラク!<br>運動会に持っていける♪
30Lの大容量で、市販の2リットルサイズのペットボトルも楽々8本収納できます♪

<br>
また、コンパクトに折りたたむことができるので、場所を取らずに収納もできます!! <br>

      ・W50xH28xD26cm<br>
<br>
【材質】<br>
バッグ部分<br>
表面：ポリエステル 100%<br>
裏面：アルミ蒸着フィルム(発砲ポリエチレン、PETフィルム)<br>
<br>
ハンドル部分：アルミ合金<br>
耐荷重：8kg<br><style type="text/css">
